import { makeStyles } from "@material-ui/core";
import { colors } from "../../../../themes/colors";

export const useStyles = makeStyles((theme) => ({
  Container: {
    backgroundColor: colors.grey,
    width: "30vw",
    padding: 15,
  },
  ContainerButtons: {
    backgroundColor: "#ccceee",
    justifyContent: "space-between",
    display: "flex",
    width:"80%"
  },
}));
